import React from "react";
import "./collection-item.style.scss";

const Collection = ({name, imageUrl}) => {
  return (
    <div className="collection-item">
      <h2>{name}</h2>  
      <div className="image" style={{backgroundImage:`url(${imageUrl})`}}></div>
    </div>
  );
};


export default Collection;
